(v.) 
a. to stop; 
b. attract and hold someone's attention; 
c. seize, capture

(v) Strictly limit a role, range of activity, or area; 
(syn.) confine, limit
(v.) in math, to be constructed around so as to touch as many points as possible

(v.) 1. to cut or split open; 
2. to cling to
(n.) cleavage

(n.) 1. the act of defending or explaining or making excuses for by reasoning;
2. something that shows an action to be reasonable
3. a statement in explanation of some action or belief

(v.) reflect deeply on a subject; 
(syn.) contemplate, cogitate, mull, ponder, reflect, ruminate, speculate
(adj.) meditative

(v.) 1. to give one's business to regularly as a customer; 
2. to support, provide financial help; 
3. to treat someone as an inferior while making a show of being kind or gracious

(v.) bring into consonance or accord; to restore to friendship or harmony; make one thing compatible with another;
(syn.) harmonize, accommodate, conciliate, settle, make up
(ant.) estrange

(adj.) self-righteous, characterized by moralizing; given to use of maxims or adages; 
(adj.) saying much in few words
(syn.) pithy, concise, compendious, succinct, terse, laconic, capsule

(adj.) 1. lacking freshness, palatability, or showing deterioration from age;
2. lacking originality or spontaneity; no longer new
(syn.) dusty, cold
